import React from "react";
import "./style.css";
import "../../box-style.css"

export default function Projects() {
  return (<div className="anchor-box">
      <a name="projects"></a>

    <div id="project-container" className="box">
      <div id="project-box">
        <h1 id="project-h1">This is a project page</h1>
      </div>
    </div>
    </div>
  );
}
